string filename("iter_freqdep");
string filename_new(create_filename(filename));
ofstream DataFile(filename_new.c_str());  // output file 

struct rparams
{
    // 
double d;
double v;
double c;
double f_0;
double f_1;
double pdh;
double phh;

};

double bound(double val)
{
    val = val < 0 ? 0.0001 : val > 1.0 ? 0.9999 : val;

    return(val);
}


// recursions of all the patch frequencies
int psys_recur(void *params, gsl_vector *f)
{
    //
double d = ((struct rparams *) params)->d;
double v = ((struct rparams *) params)->v;
double c = ((struct rparams *) params)->c;
double f_0 = ((struct rparams *) params)->f_0;
double f_1 = ((struct rparams *) params)->f_1;
double pdh = ((struct rparams *) params)->pdh;
double phh = ((struct rparams *) params)->phh;

    
    
    // 

double df0dt = 0;

double df1dt = 0;

for (int rtime=0;rtime<1e7;++rtime)
{

 df0dt=f_0 + 0.01*(-((1 - v/2.)*f_0*(2*(1 - d)*pdh + d*(2*pdh*f_0 + 2*phh*(1 - f_0 - f_1) + (pdh + phh)*f_1))) + (1 - v)*f_1*(1 + (-((1 - d)*(pdh + phh)) - d*(2*pdh*f_0 + 2*phh*(1 - f_0 - f_1) + (pdh + phh)*f_1))/2.));

df1dt=f_1 + 0.01*((1 - v/2.)*f_0*(2*(1 - d)*pdh + d*(2*pdh*f_0 + 2*phh*(1 - f_0 - f_1) + (pdh + phh)*f_1)) - (f_1*((1 - d)*(pdh + phh) + d*(2*pdh*f_0 + 2*phh*(1 - f_0 - f_1) + (pdh + phh)*f_1)))/2. + 2*(1 + c/2. - v/2.)*(1 - f_0 - f_1)*(1 + (-2*(1 - d)*phh - d*(2*pdh*f_0 + 2*phh*(1 - f_0 - f_1) + (pdh + phh)*f_1))/2.) - (1 - v)*f_1*(1 + (-((1 - d)*(pdh + phh)) - d*(2*pdh*f_0 + 2*phh*(1 - f_0 - f_1) + (pdh + phh)*f_1))/2.));

if (fabs(df0dt-f_0)<1e-7 && fabs(df1dt-f_1)<1e-7)
{

f_0=bound(df0dt);

f_1=bound(df1dt);

break;
}
f_0=bound(df0dt);

f_1=bound(df1dt);

}
gsl_vector_set(f,0,df0dt);
gsl_vector_set(f,1,df1dt);
    
    return GSL_SUCCESS;
}


